function add() {

    let add = 40 + 4;
    return add;

}
function sub(a, b) {
    let sub = a - b;
    return sub;
}
function div(a, b) {
    let div = a / b;
    return div;

}
function mul(a, b) {
    let mul = a * b;
    return mul;

}

export {add, sub, mul, div};
